package br.poli.ecomp.geav.nhe.model.db.ptc;import br.poli.ecomp.geav.nhe.model.db.Table;import br.poli.ecomp.geav.nhe.model.db.per.IPerfil;import br.poli.ecomp.geav.nhe.model.db.pro.IProjeto;import br.poli.ecomp.geav.nhe.model.db.usu.IUsuario;public class Participacao extends Table implements IParticipacao{	private int ptc_identificador;	private IProjeto pro_identificador;	private IUsuario usu_identificador;	private IPerfil per_identificador;		public Participacao(){}		@Override	public IPerfil get_per_identificador() {		return this.per_identificador;	}	@Override	public IProjeto get_pro_identificador() {		return this.pro_identificador;	}	@Override	public int get_ptc_identificador() {		return this.ptc_identificador;	}	@Override	public IUsuario get_usu_identificador() {		return this.usu_identificador;	}	@Override	public void set_per_identificador(IPerfil value) {		this.per_identificador = value;			}	@Override	public void set_pro_identificador(IProjeto value) {		this.pro_identificador = value;			}	@Override	public void set_ptc_identificador(int value) {		this.ptc_identificador = value;			}	@Override	public void set_usu_identificador(IUsuario value) {		this.usu_identificador = value;			}}